import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './components/Header';
import HeroSection from './components/HeroSection';
import InfoCard from './components/InfoCard';
import Footer from './components/Footer';
import Cards from './components/Cards';
import indexCardDetail from './resources/Details/indexCardDetail'

function createCard(detail){
  console.log(detail.location);
  const baseUrl = "./src/resources/images/home/";
  return (
    <Cards 
      key={detail.id}
      location={baseUrl + detail.location}
      title={detail.title}
      text={detail.text}
    />
  );
}


class App extends Component{
  render(){
    return (
      <div className="container">
        <Header />
        <HeroSection />
        {indexCardDetail.map(createCard)} 
        <Footer />          
      </div>
    )
  }
}


export default App;
